import React from 'react';
import{Link} from "react-router-dom";
import "./Home.css";
function Home(){
    return(
        <section className="home">
        <div className="home">
        <p>
            <nav>
                <ul>
                    <div className='hmpg'>
                        <img src='lg.png' alt='lg'></img>
                    </div>
                </ul>
            </nav>
        </p>
        </div>
        </section>
    )
} 
export default Home;
